import React from 'react'
import { Routes, Route } from "react-router-dom";
import Product from "./pages/products";
import {ToastContainer, toast } from "react-toastify";

const App = () => {
  return (
    <div className="App">
    <Routes>
      <Route path="/" element={<Product/>} />
      <ToastContainer />

    </Routes>
  </div>
  )
}

export default App
